class App extends React.Component {
  render(){
  return (
    <div className="App">
    <Router>
    <Switch>
      <Route path="/" component={Homepage} />
      <Route path="/about" component={About} />
    </Switch>
    </Router>
    </div>

  );
}
}

export default App;
